import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Home from "./components/home/home"
import Groupomania from "./site/groupomania/groupomania"
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/Nicolas" component={Home}/>
          <Route path="/Nicolas Bictel | groupomania" component={Groupomania}/>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
